def solve(string):
    numbers = []
    for char in string:
        if char.isdigit():
            numbers.append(char)
    for num in numbers:
        string = string.replace(num, '')
    string += ''.join(numbers)
    return string

def solve(string):
    numbers = ""
    for char in string:
        if char.isdigit():
            numbers += char
    for num in numbers:
        string = string.replace(num, "")
    return numbers + string

def solve(numbers, string):
    new_string = ""
    for num in numbers:
        new_string += str(num)
    return string + new_string

def solve(numbers, string):
    nums = [int(num) for num in numbers.split() if num.isdigit()]
    chars = [char for char in string if char.isalpha()]
    return "".join(chars) + " " + " ".join(str(num) for num in nums)

